import React from 'react';
import Img from '../images'

function movie() {
    return (


        <div>

          <MovieImg className="imgwrapper">
             <img className="profileuserimg"
                             src={'../images/movie.jpg'}
                             alt=""/>
         </MovieImg>
            
        </div>
    )
}

export default movie
